import React from "react";
import PropTypes from 'prop-types';
import todoData from './todoData.json';

const Header = ({ title }) => {
  return (
    <>
      <h1>{title}</h1>
    </>
  );
};

const App = () => {
  const title = 'Todo List';

  return (
    <>
      <Header title={title}/>
    </>
  );
};

Header.propTypes = {
  number: PropTypes.number,
};

export default App;
// export { App };
